import React from 'react';
import styled from 'styled-components';

const Form = styled.form`
    margin: 0 auto;
    display: flex;
    flex-direction: column;
`

const Input = styled.input`
    width: 300px;
`

const Button = styled.button`
    width: 100px;

`

function Contact() {
  return <Form>
      <Input type="text" require  placeholder="Name.."></Input>
      <Input type="text" require  placeholder="Surname.."></Input>
      <Input type="text" require  placeholder="Phone number.."></Input>
      <Input type="email" require  placeholder="Email.."></Input>
  </Form>;
}

export default Contact;
